import logo from './logo.svg';
import './App.css';
import UserGreeting from './components/UserGreeting';
import NameList from './components/NameList';
import NameKey from './components/NameKey';
import Stylesheet from './components/Stylesheet';


function App() {
  return (
    <div className='App'>
        <UserGreeting/>
        {/* <NameList/> */}
        <NameKey/>
        <br/>
        <Stylesheet/>
    </div>
  );
}

export default App;
